      <h1>Pallo Rafutho</h1>
      <h5 className='text-light'>University Graduate</h5>
      <links>
        <a
          className="App-link"
          href="https://github.com/pallo-rafutho"
                    
        >
          github "\n"
        </a>
        <a className="linkedin"
        href="https://github.com/pallo-rafutho">
          linkedin
        </a>
      </links>
    </div>
  );
}

export default Con;
